import FetchOpenWeather from '../FetchOpenWeather/FetchOpenWeather'

export default class AirTemperature extends Component {
    constructor(props) {
        super()
        this.testTemp = {
            temp:'еуые'
        };
    }
    componentDidMount() {
        this.setState(state => ({temp:FetchOpenWeather(this.props.city)}))
    }
    render() {
        return(
            <div>{this.testTemp.temp}</div>
        )
    }
}
